type ButtonProps = {
    text?: string,
    number?: number,
    array?: Array<string>,
    children?:string,
}

export function Button(props: ButtonProps){
    return(
        <button>{props.text || props.number || "Default"}</button>
    )
}
export function ButtonChildren(props: ButtonProps){
    return(
        <button>{props.children || "Default"}</button>
    )
}
